if(localStorage.getItem("local") === null){
  localStorage.setItem("local", JSON.stringify([]));
}

function addProductToCart(item) {
  let currentProduct = product.find(e => e.id === item);
  let currentCart = JSON.parse(localStorage.getItem("local"));
  let existingProduct = currentCart.find(e => e.id === item);
  
  if (existingProduct === undefined) {
    localStorage.setItem('local', JSON.stringify([...currentCart, currentProduct]));
  } else {
    let updatedCart = currentCart.map(e => {
      if (e.id === item) {
        return { ...e, count: e.count + 1 };
      }
      return e;
    });
    localStorage.setItem('local', JSON.stringify(updatedCart));
  }
}

function displayProducts() {
  product.forEach(e => {
    all.innerHTML += `
      <div class="card">
        <img class="card-img-top" src=${e.image} alt="Card image cap">
        <div class="card-body">
          <h5 class="card-title">${e.title}</h5>
          <p class="card-text">${e.price}$</p>
          <a onclick='addProductToCart(${e.id})' class="btn btn-primary">Sepete Ekle</a>
        </div>
      </div>
    `
  });
}

